export const BookingDetailsReducer = (state = { loading: true }, action) => {
  switch (action.type) {
    case BOOKING_REGISTRATION_DATA_REQUEST:
      return { loading: true };
    case BOOKING_REGISTRATION_DATA_SUCCESS:
